import classes from "./Modal.module.css";

const Backdrop = () => {
  return <div className={classes.backdrop}></div>;
};

const ModalOverlay = () => {
  return <div className={classes.modal}></div>;
};

const Modal = (props) => {
  return <div className={classes.modal}>{props.children}</div>;
};

export default Modal;
